import React from "react";
import "./Navigation.css";
function Navigation() {
  return (
    <div className="alert alert-light">
      <ul>
        <li>Navbar</li>
        <a href="#Top Heading">
          {" "}
          <li>Top Headlines</li>{" "}
        </a>
        <a href="#Business">
          {" "}
          <li>Business</li>
        </a>
        <a href="#Entertainment">
          {" "}
          <li>Entertainment</li>
        </a>
        <a href="#Health">
          {" "}
          <li>Health</li>
        </a>
        <a href="#Technology">
          {" "}
          <li>Technology</li>
        </a>
        <a href="#Sports">
          {" "}
          <li>Sports</li>
        </a>
        <a href="#Science">
          {" "}
          <li>Science</li>
        </a>
      </ul>
    </div>
  );
}

export default Navigation;
